Not to make this a `jq` tutorial, but here are the shell commands I used to look at the HumanEval problem set:<br><br>```<br>curl -L -q -s <a href="https://github.com/openai/human-eval/raw/master/data/HumanEval.jsonl.gz">https://github.com/openai/human-eval/raw/master/data/HumanEval.jsonl.gz</a> | gzip -cd |\<br> jq --sr &#39;.[0] | &quot;
\(.task_id)
 \(.prompt)&quot;&#39;<br>```<br>(replace the .[0] which means &quot;first element&quot; with `.[1]` for the second problem and `.[-1]` for the last problem).<br><br>To get the one with highest number of characters in the test set, I used:<br>```<br>curl -L -q -s <a href="https://github.com/openai/human-eval/raw/master/data/HumanEval.jsonl.gz">https://github.com/openai/human-eval/raw/master/data/HumanEval.jsonl.gz</a> | gzip -cd |\<br> jq -sr &#39;([ .[].test | length ] | max) as $m | map(select (.test | length == $m))[0] | &quot;
\(.task_id)
 \(.prompt)&quot;&#39;<br>```<br><br>Which first assigns the length of the longest `.test` field to the `$m` variable, and then selects the first element (problem) where the length of the `.test` field is equal to that maximum length stored in `$m`.
